import React from 'react';
import styles from './Footer.module.css';

const Footer = () => {
  return (
    <footer className={styles.siteFooter}>
      <div className="container">
        <div className="row">
          <div className="col-sm-12 col-md-6">
            <h6>About</h6>
            <p className="text-justify">
              Your Website Name <i>CODE WANTS TO BE SIMPLE </i> is an initiative to help the upcoming programmers with the code. Your Website Name focuses on providing the most efficient code or snippets as the code wants to be simple. We will help programmers build up concepts in different programming languages that include C, C++, Java, HTML, CSS, Bootstrap, JavaScript, PHP, Android, SQL, and Algorithm.
            </p>
          </div>

          <div className="col-xs-6 col-md-3">
            <h6>Categories</h6>
            <ul className={styles.footerLinks}>
              <li><a href="http://yourwebsitename.com/category/c-language/">C</a></li>
              <li><a href="http://yourwebsitename.com/category/front-end-development/">UI Design</a></li>
              <li><a href="http://yourwebsitename.com/category/back-end-development/">PHP</a></li>
              <li><a href="http://yourwebsitename.com/category/java-programming-language/">Java</a></li>
              <li><a href="http://yourwebsitename.com/category/android/">Android</a></li>
              <li><a href="http://yourwebsitename.com/category/templates/">Templates</a></li>
            </ul>
          </div>

          <div className="col-xs-6 col-md-3">
            <h6>Quick Links</h6>
            <ul className={styles.footerLinks}>
              <li><a href="http://yourwebsitename.com/about/">About Us</a></li>
              <li><a href="http://yourwebsitename.com/contact/">Contact Us</a></li>
              <li><a href="http://yourwebsitename.com/contribute-at-yourwebsitename/">Contribute</a></li>
              <li><a href="http://yourwebsitename.com/privacy-policy/">Privacy Policy</a></li>
              <li><a href="http://yourwebsitename.com/sitemap/">Sitemap</a></li>
            </ul>
          </div>
        </div>
        <hr />
      </div>
      <div className="container">
        <div className="row">
          <div className="col-md-8 col-sm-6 col-xs-12">
            <p className={styles.copyrightText}>
              Copyright &copy; 2023 All Rights Reserved by
              <a href="#"> Your Website Name</a>.
            </p>
          </div>

          <div className="col-md-4 col-sm-6 col-xs-12">
            <ul className={styles.socialIcons}>
              <li><a className={styles.facebook} href="#"><i className="fab fa-facebook"></i></a></li>
              <li><a className={styles.twitter} href="#"><i className="fab fa-twitter"></i></a></li>
              <li><a className={styles.dribbble} href="#"><i className="fab fa-dribbble"></i></a></li>
              <li><a className={styles.linkedin} href="#"><i className="fab fa-linkedin"></i></a></li>
            </ul>
          </div>
        </div>
      </div>
    </footer>
  );
};

export default Footer;















